import './App.css';
import MyField from './components/MyField';
import MyModal from './components/MyModal'
import logo from './images/Logos-light/Logo-standalone-default-full-colour@1x.svg';



function App() {

  return (

      <div className="App">
          <img src={logo} className="logo" alt="logo"  />
          <MyField />
          <MyModal />
      </div>
  );
}

export default App;
